import React from 'react'
import StartStop from './StartStop'

class Address extends React.Component {

  render() {

    const styles = {
      alignItems: 'left',
      // display: 'flex',
      flexDirection: 'row',
      width: '400',
    }

    return (
      <div>
        <div style={styles}><h2>Server: </h2>{this.props.name}</div>
        <StartStop />
      </div>
    )
  }

}

export default Address
